import React from "react";

const Upload = () => {
  return (
    <form>
      <div>
        <label htmlFor="name">Book title</label>
        <input id="name" />
      </div>
      <div>
        <label htmlFor="price">Price</label>
        <input id="price" />
      </div>
      <div>
        <label htmlFor="city">City of neighborhood</label>
        <input id="city" />
      </div>
      <button>Add Image</button>
    </form>
  );
};

export default Upload;
